selector_to_html = {"a[href=\"references.html#lpddr4-test-board-d6\"]": "<img alt=\"_images/D63.png\" id=\"lpddr4-test-board-d6\" src=\"_images/D63.png\"/>", "a[href=\"references.html#lpddr4-test-board-prog-b1\"]": "<img alt=\"_images/PROG_B12.png\" id=\"lpddr4-test-board-prog-b1\" src=\"_images/PROG_B12.png\"/>", "a[href=\"references.html#lpddr4-test-board-pwr2\"]": "<img alt=\"_images/PWR2.png\" id=\"lpddr4-test-board-pwr2\" src=\"_images/PWR2.png\"/>", "a[href=\"references.html#lpddr4-test-board-j1\"]": "<img alt=\"_images/J18.png\" id=\"lpddr4-test-board-j1\" src=\"_images/J18.png\"/>", "a[href=\"references.html#lpddr4-test-board-j8\"]": "<img alt=\"_images/J82.png\" id=\"lpddr4-test-board-j8\" src=\"_images/J82.png\"/>", "a[href=\"#id1\"]": "<figure class=\"align-default\" id=\"id1\">\n<img alt=\"\" src=\"_images/lpddr4-test-board-1.0.4.png\"/>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 10 </span><span class=\"caption-text\"><span class=\"caption-text\">\nLPDDR4 Test Board</span><a class=\"headerlink\" href=\"#id1\" title=\"Permalink to this image\">\u00b6</a></span></p></figcaption>\n</figure>", "a[href=\"references.html#lpddr4-test-board-pwr3\"]": "<img alt=\"_images/PWR3.png\" id=\"lpddr4-test-board-pwr3\" src=\"_images/PWR3.png\"/>", "a[href=\"references.html#lpddr4-test-board-j7\"]": "<img alt=\"_images/J73.png\" id=\"lpddr4-test-board-j7\" src=\"_images/J73.png\"/>", "a[href=\"references.html#lpddr4-test-board-pwr5\"]": "<img alt=\"_images/PWR5.png\" id=\"lpddr4-test-board-pwr5\" src=\"_images/PWR5.png\"/>", "a[href=\"references.html#lpddr4-test-board-pwr4\"]": "<img alt=\"_images/PWR4.png\" id=\"lpddr4-test-board-pwr4\" src=\"_images/PWR4.png\"/>", "a[href=\"references.html#lpddr4-test-board-pwr6\"]": "<img alt=\"_images/PWR6.png\" id=\"lpddr4-test-board-pwr6\" src=\"_images/PWR6.png\"/>", "a[href=\"references.html#lpddr4-test-board-s1\"]": "<img alt=\"_images/S12.png\" id=\"lpddr4-test-board-s1\" src=\"_images/S12.png\"/>", "a[href=\"references.html#lpddr4-test-board-d9\"]": "<img alt=\"_images/D92.png\" id=\"lpddr4-test-board-d9\" src=\"_images/D92.png\"/>", "a[href=\"lpddr4_test_bed.html\"]": "<h1 class=\"tippy-header\" id=\"lpddr4-test-bed\" style=\"margin-top: 0;\">LPDDR4 Test Bed<a class=\"headerlink\" href=\"#lpddr4-test-bed\" title=\"Link to this heading\">\u00b6</a></h1><p>This accessory allows interfacing with a single LPDDR4 ICs using the <a class=\"reference internal\" href=\"lpddr4_test_board.html\"><span class=\"doc std std-doc\">LPDDR4 Test Board</span></a>.\nThe hardware design of the LPDDR4 Test Bed is released to GitHub (<a class=\"reference external\" href=\"https://github.com/antmicro/lpddr4-testbed\">https://github.com/antmicro/lpddr4-testbed</a>) as open source hardware.\nThe hardware design includes Micron <a class=\"reference external\" href=\"https://www.micron.com/products/dram/lpdram/part-catalog/mt53e1g32d2np-046-wt\">MT53E1G32D2NP-046</a>.\nThe LPDDR4 Test Bed exposes only one memory channel (channel A) to the FPGA located on a matching test board.</p>", "a[href=\"ddr5_test_bed.html\"]": "<h1 class=\"tippy-header\" id=\"ddr5-test-bed\" style=\"margin-top: 0;\">DDR5 Test Bed<a class=\"headerlink\" href=\"#ddr5-test-bed\" title=\"Link to this heading\">\u00b6</a></h1><p>This accessory allows interfacing with a single DDR5 ICs using the <a class=\"reference internal\" href=\"lpddr4_test_board.html\"><span class=\"doc std std-doc\">LPDDR4 Test Board</span></a>.\nThe hardware design of the DDR5 Test Bed is released to GitHub (<a class=\"reference external\" href=\"https://github.com/antmicro/ddr5-testbed\">https://github.com/antmicro/ddr5-testbed</a>) as open source hardware.\nThe hardware design of the DDR5 Test Bed includes a single Micron <a class=\"reference external\" href=\"https://www.farnell.com/datasheets/3704816.pdf\">MT60B2G8HB-48B:A</a> 16Gb DRAM.\nThe DDR5 Test Bed exposes only one memory channel (channel A) to the FPGA located on a matching test board.</p><p>The DDR5 IC needs to be soldered to a custom <a class=\"reference external\" href=\"https://github.com/antmicro/ddr5-testbed/\">DDR5 Testbed</a> PCB which is available on GitHub as open source hardware.</p>", "a[href=\"references.html#lpddr4-test-board-d3\"]": "<img alt=\"_images/D31.png\" id=\"lpddr4-test-board-d3\" src=\"_images/D31.png\"/>", "a[href=\"references.html#lpddr4-test-board-d8\"]": "<img alt=\"_images/D83.png\" id=\"lpddr4-test-board-d8\" src=\"_images/D83.png\"/>", "a[href=\"references.html#lpddr4-test-board-j6\"]": "<img alt=\"_images/J63.png\" id=\"lpddr4-test-board-j6\" src=\"_images/J63.png\"/>", "a[href=\"references.html#lpddr4-test-board-d2\"]": "<img alt=\"_images/D23.png\" id=\"lpddr4-test-board-d2\" src=\"_images/D23.png\"/>", "a[href=\"#lpddr4-test-board-interface-map\"]": "<figure class=\"align-default\" id=\"lpddr4-test-board-interface-map\">\n<img alt=\"LPDDR4 test board interface map\" src=\"_images/lpddr4-test-board-1.0.4-descriptions.png\"/>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 11 </span><span class=\"caption-text\"><span class=\"caption-text\">\nLPDDR4 test board interface map</span><a class=\"headerlink\" href=\"#lpddr4-test-board-interface-map\" title=\"Permalink to this image\">\u00b6</a></span></p></figcaption>\n</figure>", "a[href=\"references.html#lpddr4-test-board-j2\"]": "<img alt=\"_images/J23.png\" id=\"lpddr4-test-board-j2\" src=\"_images/J23.png\"/>", "a[href=\"references.html#lpddr4-test-board-j9\"]": "<img alt=\"_images/J92.png\" id=\"lpddr4-test-board-j9\" src=\"_images/J92.png\"/>", "a[href=\"references.html#lpddr4-test-board-pwr1\"]": "<img alt=\"_images/PWR12.png\" id=\"lpddr4-test-board-pwr1\" src=\"_images/PWR12.png\"/>", "a[href=\"references.html#lpddr4-test-board-j5\"]": "<img alt=\"_images/J53.png\" id=\"lpddr4-test-board-j5\" src=\"_images/J53.png\"/>", "a[href=\"references.html#lpddr4-test-board-j4\"]": "<img alt=\"_images/J42.png\" id=\"lpddr4-test-board-j4\" src=\"_images/J42.png\"/>", "a[href=\"references.html#lpddr4-test-board-d5\"]": "<img alt=\"_images/D53.png\" id=\"lpddr4-test-board-d5\" src=\"_images/D53.png\"/>", "a[href=\"references.html#lpddr4-test-board-j3\"]": "<img alt=\"_images/J33.png\" id=\"lpddr4-test-board-j3\" src=\"_images/J33.png\"/>", "a[href=\"references.html#lpddr4-test-board-usr-btn2\"]": "<img alt=\"_images/USR_BTN2.png\" id=\"lpddr4-test-board-usr-btn2\" src=\"_images/USR_BTN2.png\"/>", "a[href=\"references.html#lpddr4-test-board-usr-btn1\"]": "<img alt=\"_images/USR_BTN1.png\" id=\"lpddr4-test-board-usr-btn1\" src=\"_images/USR_BTN1.png\"/>", "a[href=\"references.html#lpddr4-test-board-usr-btn4\"]": "<img alt=\"_images/USR_BTN4.png\" id=\"lpddr4-test-board-usr-btn4\" src=\"_images/USR_BTN4.png\"/>", "a[href=\"build/lpddr4_test_board/documentation/index.html\"]": "<h1 class=\"tippy-header\" id=\"documentation-for-row-hammer-tester-lpddr4-test-board\" style=\"margin-top: 0;\">Documentation for Row Hammer Tester LPDDR4 Test Board<a class=\"headerlink\" href=\"#documentation-for-row-hammer-tester-lpddr4-test-board\" title=\"Link to this heading\">\u00b6</a></h1>", "a[href=\"references.html#lpddr4-test-board-usr-btn3\"]": "<img alt=\"_images/USR_BTN3.png\" id=\"lpddr4-test-board-usr-btn3\" src=\"_images/USR_BTN3.png\"/>", "a[href=\"references.html#lpddr4-test-board-mode1\"]": "<img alt=\"_images/MODE11.png\" id=\"lpddr4-test-board-mode1\" src=\"_images/MODE11.png\"/>", "a[href=\"references.html#lpddr4-test-board-d1\"]": "<img alt=\"_images/D16.png\" id=\"lpddr4-test-board-d1\" src=\"_images/D16.png\"/>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`p ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
